INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Envío', 'Nuestros términos y condiciones de envío', 'condiciones, entrega, plazo, envío, paquete', '<h2>Envíos y devoluciones</h2>\n<h3>Envío del paquete</h3>\n<p>Como norma general, los paquetes se envían dentro de las 48 horas siguientes a la recepción del pago, través de UPS con número de seguimiento y entrega sin firma. Si prefieres el envío certificado mediante UPS Extra, se aplicará un cargo adicional. Ponte en contacto con nosotros antes de solicitar esta opción. Sea cual sea la forma de envío que elijas, te proporcionaremos un enlace para que puedas seguir tu pedido en línea.</p>\n<p>Los gastos de envío incluyen los gastos de manipulación y empaquetado, así como los gastos postales. Los gastos de manipulación tienen un precio fijo, mientras que los gastos de transporte pueden variar según el peso total del paquete. Te aconsejamos que agrupes todos tus artículos en un mismo pedido. No podemos combinar dos pedidos diferentes, y los gastos de envío se aplicarán para cada uno de manera individual. No nos hacemos responsables de los daños que pueda sufrir tu paquete tras el envío, pero hacemos todo lo posible para proteger todos los artículos frágiles.<br /><br />Las cajas son grandes y tus artículos estarán bien protegidos.</p>', 'entrega'),
(2, 1, 1, 'Aviso de privacidad', 'Aviso legal', 'aviso, legal, créditos', '<h2>Aviso de Privacidad</h2>\n<p>En Consorcio Hospitalario, S.A. de C.V., con domicilio en Calle Chilardi #179 Col. Villaseñor, Guadalajara, Jalisco México. C.P. 44600, la información de nuestros clientes y clientes potenciales es tratada de forma estrictamente confidencial y es muy importante por lo que hacemos un esfuerzo permanente para salvaguardarla.</p>\n<p>FINALIDADES Y TRANSFERENCIA DE LOS DATOS PERSONALES</p>\n<p>Más que una política, en Consorcio Hospitalario, S.A. de C.V. tenemos la filosofía de mantener una relación estrecha y activa con nuestros clientes. Al proporcionar sus datos personales, consiente su tratamiento en los Estados Unidos Mexicanos y entiende que podrán ser tratados directa o indirectamente por Consorcio Hospitalario, S.A. de C.V., sus sociedades subsidiarias, afiliadas o relacionadas y/o sus terceros proveedores de servicios, así como en su caso autoridades competentes, con las siguientes finalidades:</p>\n<p>Proveerle un bien y/o servicio.</p>\n<p>Dar cumplimiento a requerimientos legales.</p>\n<p>Realizar actividades de mercadeo y promoción en general.</p>\n<p>Ofrecerle nuestros productos, servicios e información de nuestros socios de negocios.</p>\n<p>Análisis estadísticos y de mercado.</p>\n<p>Mantener actualizados nuestros registros para poder responder a sus consultas, invitarle a eventos, hacer válida la garantía de sus prendas, informarle acerca de cambios o especificaciones de los artículos comprados, hacer de su conocimiento nuestras promociones y lanzamientos y mantener comunicación en general, así como, dar seguimiento a nuestra relación comercial.</p>\n<p>Para prevenir el acceso no autorizado a sus datos personales y con el fin de asegurar que la información sea utilizada para los fines establecidos en este aviso de privacidad, hemos establecido procedimientos físicos, electrónicos y administrativos, utilizando tecnologías avanzadas que limitan el uso o divulgación de sus datos, permitiéndonos tratarlos debidamente.</p>\n<p>SOLICITUD DE ACCESO, RECTIFICACIÓN, CANCELACIÓN U OPOSICIÓN DE DATOS PERSONALES Y REVOCACIÓN DEL CONSENTIMIENTO (SOLICITUD ARCO)</p>\n<p>Todos sus datos personales son tratados de acuerdo a la legislación aplicable y vigente en el país, por ello le informamos que usted tiene en todo momento el derecho de acceder, rectificar, cancelar u oponerse al tratamiento que le damos a sus datos personales, así como revocar el consentimiento otorgado para el tratamiento de los mismos; derecho que podrá hacer valer a través de Consorcio Hospitalario, S.A. de C.V., en sus teléfonos: 33-32801750 o por medio de su correo electrónico: sistemas@consorciohospitalario.com</p>\n<p>A través de estos canales usted podrá actualizar sus datos y especificar el medio por el cual desea recibir información, ya que en caso de no contar con esta especificación de su parte, Consorcio Hospitalario, S.A. de C.V. establecerá el canal que considere pertinente para enviarle información.</p>\n<p>Asimismo, usted tiene derecho a iniciar un procedimiento de protección de derechos ante el Instituto Federal de Acceso a la Información y Protección de Datos (IFAI), siempre y cuando reúna los requisitos señalados en la legislación aplicable y vigente, en los casos siguientes: (i) cuando Consorcio Hospitalario, S.A. de C.V. no responda a su Solicitud ARCO dentro de los 20 días siguientes de haberla recibido (ii) dentro de los 15 días siguientes de haber recibido una respuesta por parte de Consorcio Hospitalario, S.A. de C.V. pero ésta no cumpla con lo establecido en la legislación aplicable y vigente en materia de protección de datos personales.</p>\n<p>Este aviso de privacidad podrá ser modificado de tiempo en tiempo por Consorcio Hospitalario, S.A. de C.V.. Dichas modificaciones serán oportunamente informadas a través de nuestra página en internet, o cualquier otro medio de comunicación que Consorcio Hospitalario, S.A. de C.V.. considere.</p>', 'aviso-de-privacidad'),
(3, 1, 1, 'Políticas de venta', 'Nuestras políticas de venta', 'condiciones, términos, uso, venta', '<h1 class="page-heading">Políticas de venta</h1>\n<p>Condiciones de pago:</p>\n<p>Pedidos menores a $20mil o Persona Física / Distribuidor se requiere el 100% de anticipo.</p>\n<p>Pedidos mayores a $20mil anticipo es de 50%.</p>\n<p>Pedidos con OC y sin anticipo queda a reserva del agente de ventas y/o de que la empresa sea ya cliente.</p>\n<p></p>\n<p>Estos precios son más IVA. Excepto artículos de inventario (sin mínimos). El tiempo de entrega después de realizado el pedido es de 4-6 semanas en caso de que sea de inventario, embarque al día siguiente del depósito en caso de que sea de inventario.</p>\n<p>Esperamos vernos favorecidos con su pedido.</p>', 'politicas-de-venta'),
(4, 1, 1, 'Sobre nosotros', 'Averigüe más sobre nosotros', 'sobre nosotros, información', '<h1 class="page-heading bottom-indent">Sobre nosotros</h1>\n<div class="row">\n<div class="col-xs-12 col-sm-4">\n<div class="cms-block">\n<h3 class="page-subheading">Misión</h3>\n<p><span>Ser una Empresa nacional de reputación intachable dedicada a comercializar productos de calidad para la salud humana, que supere las expectativas de sus clientes; para lograrlo enfocamos nuestros esfuerzos en la formación, desarrollo profesional y humano de nuestro personal dentro de un ambiente sano.</span><br /><br /><span class="title_blue_us"></span></p>\n<h3 class="page-subheading">Visión</h3>\n<p><br /><span>Lograr una posición consolidada dentro del ramo farmacéutico con participación positiva año tras año en los diferentes procedimientos de adquisiciones gubernamentales</span><br /><span>Impulsar continuamente el desarrollo de todas las personas que colaboran con la empresa e incrementar el patrimonio para garantizar el crecimiento sostenido.</span><br /><br /><span class="title_blue_us"></span></p>\n<h3 class="page-subheading">Valores</h3>\n<ul><li>Compromiso</li>\n<li>Honestidad</li>\n<li>Lealtad</li>\n<li>Superación</li>\n<li>Trabajo en equipo</li>\n<li>Actitud Emprendedora</li>\n<li>Disciplina</li>\n</ul><p></p>\n</div>\n</div>\n</div>', 'sobre-nosotros'),
(5, 1, 1, 'Información de envío', 'Conoce nuestra información y políticas de envío', 'pago seguro, ssl, visa, mastercard, paypal', '<h2>Información de envío</h2>\n<p>Con SSL</p>\n<h3><b>Política de envios locales:</b></h3>\n<p><span>Facturación mínima de $1,000.00 enviío a domicilio.</span><br /><span>Pedidos recibidos hasta las 12:00pm se surten el mismo día, los recibidos después de las 12:00pm se surten hasta el día siguiente. </span><br /><br /><b></b></p>\n<h3><b>Política de envios foráneos:</b></h3>\n<p><span>Facturación mínima de $2,500.00</span><br /><span>Pedidos recibidos antes de las 12:00pm se envían el mismo día, los recibidos posteriormente a las 12:0pm se programan para el día siguiente. </span><br /><br /><b></b></p>\n<h3><b>Horarios:</b></h3>\n<p><span>Lunes 8:00am a 6:00pm</span><br /><span>Martes a viernes 8:00am a 5:30pm</span></p>', 'informacion-de-envio');
