(223, 1, 1, 'Agarosa ideal para pruebas de rutina en separaciones rápidas de ADN y fragmentos de ARN, así como para PCR y para la detección, preparación y clonación de plásmidos. También se utiliza para ensayos de Blotting', '', 'agarose-e-agarosa-de-rutina', '', '', '', 'AGAROSE E - Agarosa de Rutina', '', ''),
(224, 1, 1, 'Agarosa para fragmentos de ácidos nucleicos con tamaño ≥ 1000 pb. Esta agarosa es apta para ensayos de Blotting. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-d1-low-eeo', '', '', '', 'AGAROSE D1 LOW EEO', '', ''),
(225, 1, 1, 'Agarosa altamente purificada, con valores bajos de EEO y certificado de control de calidad GQT (Genetic Quality Tested). Recomendada para geles preparativos de ADN. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-d1-low-eeo-gqt-genetic-quality-tested', '', '', '', 'AGAROSE D1 LOW EEO - GQT (Genetic Quality Tested)', '', ''),
(226, 1, 1, 'Agarosa recomendada para la electroforesis de proteínas séricas e inmunoelectroforesis. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-d1-medium-eeo', '', '', '', 'AGAROSE D1 MEDIUM EEO', '', ''),
(227, 1, 1, 'Agarosa apta para inmunoelectroforesis cruzada. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-d1-high-eeo', '', '', '', 'AGAROSE D1 HIGH EEO', '', ''),
(228, 1, 1, 'Agarosa recomendada para la preparación de perlas (Agarose Beads), también puede ser utilizada para electroforesis de proteínas e inmunoelectroforesis cruzada. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-d2-alta-temperatura-de-gelificacian', '', '', '', 'AGAROSE D2 - Alta temperatura de Gelificación', '', ''),
(229, 1, 1, 'Agarosa específica para electroforesis de campos pulsados de megabases de ADN (hasta 40 Kb), recomendada para separación de ADN &gt; 1 Kb mediante electroforesis convencional y para ADN con tamaños de varias megabases mediante "Pulsed Field Gel Electrophoresis". No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-d5-alta-fuerza-de-gel', '', '', '', 'AGAROSE D5 - Alta Fuerza de Gel', '', ''),
(230, 1, 1, 'La agarosa "Finger Printing DNA" es especifica para pruebas de paternidad, verificación de líneas celulares, tipados tisulares y pruebas forénsicas. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-fp-dna-finger-printing-dna', '', '', '', 'AGAROSE F.P. DNA - Finger Printing DNA', '', ''),
(231, 1, 1, 'Agarosa recomendada para la separación de fragmentos ≥ 1000 pb en electroforesis analítica. La baja temperatura de fusión (65 °C) permite fundir la agarosa sin dañar la doble hélice de ADN. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-lm', '', '', '', 'AGAROSE LM', '', ''),
(232, 1, 1, 'Esta agarosa, con certificado de control de calidad GQT (Genetic Quality Tested), está especialmente recomendada para electroforesis preparativa de ácidos nucleicos &gt; 1000 pb y aplicaciones in-gel. No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-lm-gqt-genetic-quality-tested', '', '', '', 'AGAROSE LM GQT (Genetic Quality Tested)', '', ''),
(233, 1, 1, 'Agarosa de temperatura de fusión muy baja y capacidad más alta de resolución para fragmentos ≤ 1000 pb especial para productos PCR, entre 200 y 800 pb con certificado de control de calidad GQT (Genetic Quality Tested). No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-lm-sieve', '', '', '', 'AGAROSE LM SIEVE', '', ''),
(234, 1, 1, 'Agarosa especial para productos PCR, con capacidad de resolución para fragmentos entre 50 y 1000 pb con certificado de control de calidad GQT (Genetic Quality Tested). No se detecta la presencia de DNAsas y RNAsas', '', 'agarose-novagel-gqt-genetic-quality-tested', '', '', '', 'AGAROSE NOVAGEL GQT (Genetic Quality Tested)', '', ''),
(235, 1, 1, 'Recomendada para geles analíticos de ADN &lt; 500 pb. No se detecta la presencia de DNAsas y RNAsas y no presenta DNA Binding', '', 'agarose-ms-4-resolucian-de-adn-500-pb', '', '', '', 'AGAROSE M.S.- 4 Resolución de ADN 500 p.b.', '', ''),
(236, 1, 1, 'Eficacia resolutiva mejorada para pequeños fragmentos de ADN (10 - 1200 pb) y productos PCR. No se detecta la presencia de DNAsas y RNAsas y presenta un DNA Binding muy bajo', '', 'agarose-ms-6-metagel-resolucian-de-adn-800-pb', '', '', '', 'AGAROSE M.S.- 6 (Metagel) Resolución de ADN 800 p.b.', '', ''),
(237, 1, 1, 'Recomendada para geles analíticos de ADN &lt; 1200 pb y especialmente productos PCR. No se detecta la presencia de DNAsas ni RNAsas y no presenta DNA Binding', '', 'agarose-ms-8-resolucian-de-adn-1000-pb', '', '', '', 'AGAROSE M.S.- 8 Resolución de ADN 1000 p.b.', '', ''),
(238, 1, 1, 'Recomendada para geles analíticos de ADN, a concentración de 2% es capaz de separar fragmentos 30 - 1500 pb. No se detecta la presencia de DNAsas y RNAsas y no presenta DNA Binding', '', 'agarose-ms-12-resolucian-de-adn-1500-pb', '', '', '', 'AGAROSE M.S.- 12 Resolución de ADN 1500 p.b.', '', ''),
