INSERT INTO `ps_wtcustomhtml_lang` (`id_wtcustomhtml`, `id_shop`, `id_lang`, `title`, `content`) VALUES
(1, 1, 1, 'Customer Service', '<div class="customer-link">\r\n<h4>Customer Service</h4>\r\n<div class="block-content toggle-footer">\r\n<ul>\r\n<li><a href="#">Payment Methods</a></li>\r\n<li><a href="#">custom work</a></li>\r\n<li><a href="#">promotions</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="extra-link">\r\n<h4 class="secondary-link">Extra Links</h4>\r\n<div class="block-content toggle-footer">\r\n<ul>\r\n<li><a href="#">ask in forum</a></li>\r\n<li><a href="#">help desk</a></li>\r\n<li><a href="#">Payment Methods</a></li>\r\n</ul>\r\n</div>\r\n</div>'),
(2, 1, 1, 'Footer Links + Copy Right  + Payment', '<div class="content-top">\r\n<ul>\r\n<li><a title="Online Shopping" href="#">Online Shopping</a></li>\r\n<li><a title="Buy Sell" href="#">Buy Sell</a></li>\r\n<li><a title="All Promotions" href="#">All Promotions </a></li>\r\n<li><a title="My Orders" href="#">My Orders</a></li>\r\n<li><a title="Help" href="#">Help</a></li>\r\n<li><a title="Site Map" href="#">Site Map</a></li>\r\n<li><a title="Customer Service" href="#">Customer Service</a></li>\r\n<li><a title="About" href="#">About</a></li>\r\n<li><a title="Contact" href="#">Contact</a></li>\r\n</ul>\r\n</div>\r\n<div class="content-bottom">\r\n<p>© 2016 <a href="#">Elmart</a> Prestashop Themes by <a href="#">Waterthemes</a>.</p>\r\n</div>\r\n<div class="payment-icon">\r\n<ul>\r\n<li><a href="#"><img src="{static_block_url}themes/wt_elmart/img/cms/paypal.png" alt="" /></a></li>\r\n<li><a href="#"><img src="{static_block_url}themes/wt_elmart/img/cms/master_cart.png" alt="" /></a></li>\r\n<li><a href="#"><img src="{static_block_url}themes/wt_elmart/img/cms/visa.png" alt="" /></a></li>\r\n<li><a href="#"><img src="{static_block_url}themes/wt_elmart/img/cms/american.png" alt="" /></a></li>\r\n<li><a href="#"><img src="{static_block_url}themes/wt_elmart/img/cms/rss.png" alt="" /></a></li>\r\n</ul>\r\n</div>'),
(3, 1, 1, 'Top Home Banner', '<div class="bn-top-home clearfix">\r\n<ul class="row">\r\n<li class="col-xs-12 col-sm-6">\r\n<div class="Save-Off-Banner"><a href="#"><img src="http://localhost/consorcioHospitalario/themes/wt_elmart/img/cms/bn-top-1.jpg" alt=""/></a>\r\n<div class="out-mask">\r\n<h3>Smart watches massa</h3>\r\n<h4><a href="#">Aliquam erat</a></h4>\r\n</div>\r\n</div>\r\n</li>\r\n<li class="col-xs-12 col-sm-6">\r\n<div class="Save-Off-Banner Save-Off-Banner2"><a href="#"><img src="http://localhost/consorcioHospitalario/themes/wt_elmart/img/cms/bn-top-2.jpg" alt=""/></a>\r\n<div class="out-mask">\r\n<h3>Morbi eleifend eros posuere aliquam</h3>\r\n<h4><a href="#">order now</a></h4>\r\n</div>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>'),
(4, 1, 1, 'Top Home Save Off', '<div class="Save-Off-Banner"><a href="#"><img src="http://localhost/consorcioHospitalario/themes/wt_elmart/img/cms/bn-st-left.jpg"  alt=""/></a>\r\n<div class="out-mask">\r\n<h3>SmartTV 60’’ New</h3>\r\n<h4><a href="#">save off 25%</a></h4>\r\n</div>\r\n</div>\r\n<div class="Save-Off-Banner Save-Off-Banner1"><a href="#"><img src="http://localhost/consorcioHospitalario/themes/wt_elmart/img/cms/bn-st-left2.jpg" alt=""/></a>\r\n<div class="out-mask">\r\n<h3>Camera Waterproof</h3>\r\n<h4><a href="#">order now</a></h4>\r\n</div>\r\n</div>'),
(5, 1, 1, 'Social Footer', '<h4 class="secondary-link">follow us on</h4>\r\n<ul id="social_block" class="toggle-footer clearfix">\r\n<li class="facebook"><a class="_blank" href="http://www.facebook.com/prestashop" title="Facebook" target="_blank"> <span>Facebook</span> </a></li>\r\n<li class="twitter"><a class="_blank" href="http://www.twitter.com/prestashop" title="Twitter" target="_blank"> <span>Twitter</span> </a></li>\r\n<li class="rss"><a class="_blank" href="http://www.prestashop.com/blog/en/" title="RSS" target="_blank"> <span>RSS</span> </a></li>\r\n<li class="google-plus"><a class="_blank" href="https://www.google.com/+prestashop" title="Google Plus" target="_blank"> <span>Google Plus</span> </a></li>\r\n</ul>'),
(6, 1, 1, 'Home Banner', '<div class="banner-view-cat"><a href="#"><img src="{static_block_url}themes/wt_elmart/img/cms/bn-center.jpg" alt="" /></a></div>');
